import React, { useState, useEffect } from 'react'

function App(){

  const [data, SetData] = useState([{}])


  useEffect(()=> {

    fetch("http://localhost:5000/members").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)

        }
    )
  }, [])





  return(

    <div>
       <div className="col">
      <h1>Mi Casa</h1>
      <p>This is my house y&apos;all!</p>
      {data.map(home => <div>{home.name}</div>)}
    </div>



    </div>



  )





}

export default App;
